.scroll-down {
  position: fixed;
  left: 50%;
  bottom: 2em;
  display: block;
  width: 50px;
  height: 50px;
  margin-left: -25px;
  border: 2px solid #222;
  background: #222;
  background-size: 14px auto;
  border-radius: 50%;
  box-shadow: 0 1px 4px 2px rgba(0, 0, 0, 0.58);
  cursor: pointer;
  z-index: 9999;
  -webkit-animation: bounce 2s infinite 2s;
  animation: bounce 2s infinite 2s;
  -webkit-transition: all 0.2s ease-in;
  -o-transition: all 0.2s ease-in;
  transition: all 0.2s ease-in;
  -webkit-transform: scale(1);
  -ms-transform: scale(1);
  transform: scale(1);
}

.scroll-down:before {
  position: absolute;
  top: calc(50% - 8px);
  left: calc(50% - 6px);
  -webkit-transform: rotate(-45deg);
  -ms-transform: rotate(-45deg);
  transform: rotate(-45deg);
  display: block;
  width: 12px;
  height: 12px;
  content: "";
  border: solid #65abb0;
  border-width: 0px 0 2px 2px;
}

.scroll-down-bottom {
  background: #222;
  position: fixed;
  left: 50%;
  bottom: 2em;
  display: block;
  width: 50px;
  height: 50px;
  margin-left: -25px;
  border: 2px solid #222;
  background-size: 14px auto;
  border-radius: 50%;
  cursor: pointer;
  z-index: 9999;
  -webkit-animation: bounce 2s infinite 2s;
  animation: bounce 2s infinite 2s;
  -webkit-transition: all 0.2s ease-in;
  -o-transition: all 0.2s ease-in;
  transition: all 0.2s ease-in;
  -webkit-transform: scale(1);
  -ms-transform: scale(1);
  transform: scale(1);
}

.scroll-down-bottom:before {
  border: solid #65abb0;
  -webkit-transform: rotate(-45deg);
  -ms-transform: rotate(-45deg);
  transform: rotate(-45deg);
  position: absolute;
  top: calc(50% - 8px);
  left: calc(50% - 6px);
  display: block;
  width: 12px;
  height: 12px;
  content: "";
  border-width: 2px 2px 0px 0px;
