        }

        .course-type {
          input[type="checkbox"]:before {
            background: #202020 !important;
            border: 2px solid $background__main-theme-light;
          }

          input[type="checkbox"]:checked:before {
            background: #202020;
            border-color: $background__main-theme-light;
          }

          input[type="checkbox"]:checked:after {
            background: $background__main-theme-light;
            box-shadow: 2px 0 0 $background__main-theme-light,
              4px 0 0 $background__main-theme-light,
              4px -2px 0 $background__main-theme-light,
              4px -4px 0 $background__main-theme-light,
              4px -6px 0 $background__main-theme-light,
              4px -8px 0 $background__main-theme-light;
          }
        }
      }
    }
  }

  textarea {
    display: none;
  }

  .data-protection {
    &__title {
      border-top: 1px solid #7c7c7c;
      color: #7c7c7c;
      text-align: left;
      margin: 2em 0 0 !important;
      padding-top: 2em !important;
      @include fluid-type($min_width, $max_width, 14px, 16px);
      display: flex;
      justify-content: space-between;
      cursor: pointer;
    }

    &__expand {
      position: relative;
      width: 16px;
      height: 16px;

      &:before,
      &:after {
        content: "";
        position: absolute;
        background-color: #7c7c7c;
        transition: transform 0.4s ease-out 0s;
      }

      &:before {
        top: 0px;
        left: 50%;
        width: 2px;
        height: 16px;
        margin-left: -1px;
      }

      &:after {
        top: 50%;
        left: 0px;
        width: 16px;
        height: 2px;
        margin-top: -1px;
      }

      &--open {
        &:before {
          transform: rotate(90deg);
        }

        &:after {
          transform: rotate(180deg);
        }
      }
    }

    &__content {
      display: none;
      margin-top: 1em !important;
      text-align: left;
      color: $color_text-light;
      line-height: 1.7;
      @include fluid-type($min_width, $max_width, 14px, 16px);

      a {
        text-decoration: underline;
      }

      #rights-reserved-symbol {
        vertical-align: baseline !important;
      }

      &--open {
        display: block;
      }
    }
  }
}

