@import "./variables.scss";
@import "./clearings.scss";
@import "./mixins.scss";
@import "./header.scss";
@import "./buttons.scss";
@import "./welcome.scss";
@import "./custom-swiper.scss";
@import "./course-boxes.scss";
@import "./modal.scss";
@import "./thank-you.scss";

*,
*::before,
*::after {
  box-sizing: inherit;
  -webkit-tap-highlight-color: transparent; /* for removing the highlight */
}

html {
  box-sizing: border-box;
  height: 100%;
  scroll-behavior: smooth;
}

body {
  height: 100%;
  overflow-x: hidden;
}

h1,
h2,
h3 {
  font-family: $font_headers;
}

h1 {
  @include fluid-type($min_width, $max_width, 30px, 44px);
  font-weight: 500;
}

h2 {
  @include fluid-type($min_width, $max_width, 26px, 38px);
}

h3 {
  @include fluid-type($min_width, $max_width, 22px, 28px);
}

a {
  font-family: $font__main;
}

* :focus {
  outline: 0;
}

p {
  @include fluid-type($min_width, $max_width, 18px, 20px);
  font-family: $font__main;
  line-height: 1.5;
}

ul {
  margin: 1em 0;
  padding: 0 0;

  list-style: none;
}

.my-preloader {
  height: 100vh;
  position: fixed;
  width: 100vw;
  background: #fff;
  z-index: 99999;
  display: -webkit-box;
  display: -ms-flexbox;
  display: flex;
  -webkit-box-orient: vertical;
  -webkit-box-direction: normal;
  -ms-flex-flow: column;
  flex-flow: column;
  -webkit-box-pack: center;
  -ms-flex-pack: center;
  justify-content: center;
  -webkit-box-align: center;
  -ms-flex-align: center;
  align-items: center;
  -webkit-transition: all 0.3s ease-in;
  -o-transition: all 0.3s ease-in;
  transition: all 0.3s ease-in;
  opacity: 1;
}

.my-preloader .preloader-content {
  background: url("/assets/img/logo.png") no-repeat;
  display: block;
  height: 10em;
  width: 10em;
  background-size: contain;
  -webkit-animation: mymove 1.5s infinite;
  animation: mymove 1.5s infinite;
}

@-webkit-keyframes mymove {
  0% {
    -webkit-transform: scale(1.1);
    transform: scale(1.1);
    opacity: 0;
  }

  50% {
    opacity: 1;
    -webkit-transform: scale(1);
    transform: scale(1);
  }

  100% {
    -webkit-transform: scale(1.1);
    transform: scale(1.1);
    opacity: 0;
  }
}

@keyframes mymove {
  0% {
    -webkit-transform: scale(1.1);
    transform: scale(1.1);
    opacity: 0;
  }

  50% {
    opacity: 1;
    -webkit-transform: scale(1);
    transform: scale(1);
  }

  100% {
    -webkit-transform: scale(1.1);
    transform: scale(1.1);
    opacity: 0;
  }
}

.my-preloader-off {
  opacity: 0;
}

.my-preloader-none {
  display: none;
}

#site-scroll-top {
  display: none;
}

.scroll-down {
  opacity: 1;
  -webkit-transition: all 0.5s ease-in 3s;
  -o-transition: all 0.5s ease-in 3s;
  transition: all 0.5s ease-in 3s;
}

.scroll-down {
  position: fixed;
  left: 50%;
  bottom: 2em;
  display: block;
  width: 50px;
  height: 50px;
  margin-left: -25px;
  border: 2px solid #222;
  background: #222;
  background-size: 14px auto;
  border-radius: 50%;
  box-shadow: 0 1px 4px 2px rgb(0 0 0 / 58%);
  cursor: pointer;
  z-index: 9999;
  -webkit-animation: bounce 2s infinite 2s;
  animation: bounce 2s infinite 2s;
  -webkit-transition: all 0.2s ease-in;
  -o-transition: all 0.2s ease-in;
  transition: all 0.2s ease-in;
  -webkit-transform: scale(1);
  -ms-transform: scale(1);
  transform: scale(1);
}
.scroll-down:before {
  position: absolute;
  top: calc(50% - 8px);
  left: calc(50% - 6px);
  -webkit-transform: rotate(-45deg);
  -ms-transform: rotate(-45deg);
  transform: rotate(-45deg);
  display: block;
  width: 12px;
  height: 12px;
  content: "";
  border: solid $background__main-theme-light;
  border-width: 0px 0 2px 2px;
}
.scroll-down-bottom {
  background: #222;
  position: fixed;
  left: 50%;
  bottom: 2em;
  display: block;
  width: 50px;
  height: 50px;
  margin-left: -25px;
  border: 2px solid #222;
  background-size: 14px auto;
  border-radius: 50%;
  cursor: pointer;
  z-index: 9999;
  -webkit-animation: bounce 2s infinite 2s;
  animation: bounce 2s infinite 2s;
  -webkit-transition: all 0.2s ease-in;
  -o-transition: all 0.2s ease-in;
  transition: all 0.2s ease-in;
  -webkit-transform: scale(1);
  -ms-transform: scale(1);
  transform: scale(1);
}
.scroll-down-bottom:before {
  border: solid $background__main-theme-light;
  -webkit-transform: rotate(-45deg);
  -ms-transform: rotate(-45deg);
  transform: rotate(-45deg);
  position: absolute;
  top: calc(50% - 8px);
  left: calc(50% - 6px);
  display: block;
  width: 12px;
  height: 12px;
  content: "";
  border-width: 2px 2px 0px 0px;
}
@-webkit-keyframes bounce {
  0%,
  100%,
  20%,
  50%,
  80% {
    -webkit-transform: translateY(0);
    -ms-transform: translateY(0);
    transform: translateY(0);
  }
  40% {
    -webkit-transform: translateY(-10px);
    -ms-transform: translateY(-10px);
    transform: translateY(-10px);
  }
  60% {
    -webkit-transform: translateY(-5px);
    -ms-transform: translateY(-5px);
    transform: translateY(-5px);
  }
}
@keyframes bounce {
  0%,
  100%,
  20%,
  50%,
  80% {
    -webkit-transform: translateY(0);
    -ms-transform: translateY(0);
    transform: translateY(0);
  }
  40% {
    -webkit-transform: translateY(-10px);
    -ms-transform: translateY(-10px);
    transform: translateY(-10px);
  }
  60% {
    -webkit-transform: translateY(-5px);
    -ms-transform: translateY(-5px);
    transform: translateY(-5px);
  }
}

.site {
  opacity: 0;
  -webkit-transition: all 0.3s ease-in;
  -o-transition: all 0.3s ease-in;
  transition: all 0.3s ease-in;
}

.outer-wrap {
  opacity: 0;
}

.page-loaded {
  opacity: 1;
}

section {
  padding: 0em 1em 2em;

  @media screen and (min-width: 992px) {
    padding: 0em 15% 4em;
  }

  .section-header {
