    vertical-align: super;
    @include fluid-type($min_width, $max_width, 16px, 18px);
  }
}

.bold {
  font-weight: 700;
}

.bolder {
  font-weight: 900;
}

.banner--equipement {
  background-image: url("../img/equipement.jpg");
