    }
  }

  .happy-students {
    // background-image: url("../img/students.jpg");
    // background-image: url("../img/students.jpg"),
    //   linear-gradient($background__main-theme-light, $background__main-theme-dark); /* W3C */
    // background-repeat: no-repeat;
    // background-size: contain;
    // background-position: center;
    text-align: center;
    margin-top: 4em;

    // box-shadow: 0 0px 5px rgba(0, 0, 0, 0.3);

    img {
      object-fit: contain;
      max-height: 400px;
